"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[2135],{74395:(e,t,s)=>{s.r(t),s.d(t,{default:()=>n,johnChapter21ES:()=>o});const o={chapter:21,title:"Jean 21",version:"Reina-Valera 1909",language:"es",direction:"ltr",verses:[{number:1,text:"Despu\xe9s se manifest\xf3 Jes\xfas otra vez \xe1 sus disc\xedpulos en la mar de Tiberias; y manifest\xf3se de esta manera.",strong:[{text:"esta",strong:"G3778",start:93,end:97}]},{number:2,text:"Estaban juntos Sim\xf3n Pedro, y Tom\xe1s, llamado al D\xeddimo, y Natanael, el que era de Can\xe1 de Galilea, y los hijos de Zebedeo, y otros dos de sus disc\xedpulos.",strong:[{text:"Thomas",strong:"G2381",start:14,end:20},{text:"fils",strong:"G5207",start:72,end:76},{text:"deux",strong:"G1417",start:92,end:96}]},{number:3,text:"D\xedceles Sim\xf3n Pedro: A pescar voy. D\xedcenle: Vamos nosotros tambi\xe9n contigo. Fueron, y subieron en una barca; y aquella noche no cogieron nada.",strong:[{text:"noche",strong:"G3571",start:119,end:124},{text:"nada",strong:"G3762",start:137,end:141}]},{number:4,text:"Y venida la ma\xf1ana, Jes\xfas se puso \xe1 la ribera: mas los disc\xedpulos no entendieron que era Jes\xfas.",strong:[]},{number:5,text:"Y d\xedjoles: Mozos, \xbften\xe9is algo de comer? Respondi\xe9ronle: No.",strong:[{text:"rien",strong:"G3762",start:37,end:41}]},{number:6,text:"Y \xe9l les dice: Echad la red \xe1 la mano derecha del barco, y hallar\xe9is. Entonces la echaron, y no la pod\xedan en ninguna manera sacar, por la multitud de los peces.",strong:[{text:"mano",strong:"G5495",start:33,end:37},{text:"multitud",strong:"G3793",start:138,end:146}]},{number:7,text:"Entonces aquel disc\xedpulo, al cual amaba Jes\xfas, dijo \xe1 Pedro: El Se\xf1or es. Y Sim\xf3n Pedro, como oy\xf3 que era el Se\xf1or, ci\xf1\xf3se la ropa, porque estaba desnudo, y ech\xf3se \xe1 la mar.",strong:[{text:"como",strong:"G2531",start:89,end:93}]},{number:8,text:"Y los otros disc\xedpulos vinieron con el barco (porque no estaban lejos de tierra, sino como doscientos codos), trayendo la red de peces.",strong:[{text:"tierra",strong:"H776",start:73,end:79},{text:"como",strong:"G2531",start:86,end:90}]},{number:9,text:"Y como descendieron \xe1 tierra, vieron ascuas puestas, y un pez encima de ellas, y pan.",strong:[{text:"como",strong:"G2531",start:2,end:6},{text:"tierra",strong:"H776",start:22,end:28}]},{number:10,text:"D\xedceles Jes\xfas: Traed de los peces que cogisteis ahora.",strong:[{text:"prendre",strong:"G3880",start:56,end:63}]},{number:11,text:"Subi\xf3 Sim\xf3n Pedro, y trajo la red \xe1 tierra, llena de grandes peces, ciento cincuenta y tres: y siendo tantos, la red no se rompi\xf3.",strong:[{text:"tierra",strong:"H776",start:36,end:42},{text:"llena",strong:"G4138",start:44,end:49}]},{number:12,text:"D\xedceles Jes\xfas: Venid, comed. Y ninguno de los disc\xedpulos osaba preguntarle: \xbfT\xfa, qui\xe9n eres? sabiendo que era el Se\xf1or.",strong:[{text:"ninguno",strong:"G3762",start:31,end:38}]},{number:13,text:"Viene pues Jes\xfas, y toma el pan, y les da; y asimismo del pez.",strong:[{text:"pain",strong:"G740",start:26,end:30}]},{number:14,text:"Esta era ya la tercera vez que Jes\xfas se manifestaba \xe1 sus disc\xedpulos, habiendo resucitado de los muertos.",strong:[{text:"Esta",strong:"G3778",start:0,end:4}]},{number:15,text:"Y cuando hubieron comido, Jes\xfas dijo \xe1 Sim\xf3n Pedro: Sim\xf3n, hijo de Jon\xe1s, \xbfme amas m\xe1s que \xe9stos? D\xedcele: S\xed Se\xf1or: t\xfa sabes que te amo. D\xedcele: Apacienta mis corderos.",strong:[{text:"hijo",strong:"G5207",start:59,end:63}]},{number:16,text:"Vu\xe9lvele \xe1 decir la segunda vez: Sim\xf3n, hijo de Jon\xe1s, \xbfme amas? Resp\xf3ndele: S\xed, Se\xf1or: t\xfa sabes que te amo. D\xedcele: Apacienta mis ovejas.",strong:[{text:"decir",strong:"H559",start:11,end:16},{text:"hijo",strong:"G5207",start:40,end:44}]},{number:17,text:"D\xedcele la tercera vez: Sim\xf3n, hijo de Jon\xe1s, \xbfme amas? Entristeci\xf3se Pedro de que le dijese la tercera vez: \xbfMe amas? y d\xedcele: Se\xf1or, t\xfa sabes todas las cosas; t\xfa sabes que te amo. D\xedcele Jes\xfas: Apacienta mis ovejas.",strong:[{text:"hijo",strong:"G5207",start:30,end:34}]},{number:18,text:"De cierto, de cierto te digo: Cuando eras m\xe1s mozo, te ce\xf1\xedas, \xe9 ibas donde quer\xedas; mas cuando ya fueres viejo, extender\xe1s tus manos, y te ce\xf1ir\xe1 otro, y te llevar\xe1 donde no quieras.",strong:[]},{number:19,text:"Y esto dijo, dando \xe1 entender con qu\xe9 muerte hab\xeda de glorificar \xe1 Dios. Y dicho esto, d\xedcele: S\xedgueme.",strong:[{text:"esto",strong:"G3778",start:2,end:6},{text:"muerte",strong:"H6757",start:38,end:44},{text:"Dios",strong:"G2316",start:67,end:71},{text:"esto",strong:"G3778",start:81,end:85}]},{number:20,text:"Volvi\xe9ndose Pedro, ve \xe1 aquel disc\xedpulo al cual amaba Jes\xfas, que segu\xeda, el que tambi\xe9n se hab\xeda recostado \xe1 su pecho en la cena, y le hab\xeda dicho: Se\xf1or, \xbfqui\xe9n es el que te ha de entregar?",strong:[{text:"disciple",strong:"G3101",start:49,end:57},{text:"Seigneur",strong:"G2962",start:161,end:169}]},{number:21,text:"As\xed que Pedro vi\xf3 \xe1 \xe9ste, dice \xe1 Jes\xfas: Se\xf1or, \xbfy \xe9ste, qu\xe9?",strong:[{text:"Seigneur",strong:"G2962",start:47,end:55}]},{number:22,text:"D\xedcele Jes\xfas: Si quiero que \xe9l quede hasta que yo venga, \xbfqu\xe9 \xe1 ti? S\xedgueme t\xfa.",strong:[{text:"demeure",strong:"H1004",start:32,end:39}]},{number:23,text:"Sali\xf3 entonces este dicho entre los hermanos, que aquel disc\xedpulo no hab\xeda de morir. Mas Jes\xfas no le dijo, No morir\xe1; sino: Si quiero que \xe9l quede hasta que yo venga \xbfqu\xe9 \xe1 ti?",strong:[{text:"este",strong:"G3778",start:15,end:19}]},{number:24,text:"Este es aquel disc\xedpulo que da testimonio de estas cosas, y escribi\xf3 estas cosas: y sabemos que su testimonio es verdadero.",strong:[{text:"Este",strong:"G3778",start:0,end:4},{text:"testimonio",strong:"G3141",start:31,end:41},{text:"testimonio",strong:"G3141",start:99,end:109}]},{number:25,text:"Y hay tambi\xe9n otras muchas cosas que hizo Jes\xfas, que si se escribiesen cada una por s\xed, ni aun en el mundo pienso que cabr\xedan los libros que se habr\xedan de escribir. Am\xe9n.",strong:[{text:"cada",strong:"G3956",start:71,end:75},{text:"mundo",strong:"G2889",start:101,end:106}]}]},n=o}}]);
